document.addEventListener("DOMContentLoaded",(function(){loadData("repos.json").then((a=>{const e=$(".repos").el;a.forEach((a=>{const s=langKey(a.language),[n,d]=a.full_name.split("/"),i=el("div",{className:`box item ${s}`});a.archived&&i.classList.add("archived"),a.private&&i.classList.add("private"),i.innerHTML=`<div class="repo-header"><h3><i class="fa fa-cube" aria-hidden="true"></i><span>${n}</span>/<b>${d}</b></h3></div>`,e.appendChild(i)}))})).catch(console.error)}));